package com.naver.mage4j.external.zend.cache;

import com.naver.mage4j.external.zend.Zend_Exception;

public class Zend_Cache_Exception extends Zend_Exception {
	public Zend_Cache_Exception() {
		super();
	}

	public Zend_Cache_Exception(String message, Throwable cause) {
		super(message, cause);
	}

	public Zend_Cache_Exception(String message) {
		super(message);
	}

	public Zend_Cache_Exception(Throwable cause) {
		super(cause);
	}

}
